import React from "react";
import { Alert } from "antd";

const fraudTrades = [];

const errorTrades = ["AGD896", "ADS888"];

const errorTradeMessage = "Trade ID " + errorTrades[0] + " - Error detected.";

class Alertlist extends React.Component {
  render() {
    return (
      <div>
        <Alert
          style={{ margin: 10 }}
          message={"Potential error with trade ID: ..."}
          type="warning"
          showIcon
        />
        <Alert
          style={{ margin: 10 }}
          message="Potential fraudulent trade detected ..."
          type="error"
          showIcon
        />
      </div>
    );
  }
}
export default Alertlist;
